INSERT INTO `field_blog_category` VALUES (1,'Best Practice','best-practice','<p>Magento is an open-source e-commerce platform written in PHP for e-commerce web sites. The software was originally developed by Varien Inc., a US private company headquartered in Culver City, California, with assistance from volunteers.</p>\r\n<p>Varien published the first general-availability release of the software on March 31, 2008. Roy Rubin, former CEO of Varien, later sold a substantial share of the company to eBay, which eventually completely acquired and then spun off the company. According to the research conducted by aheadWorks in May 2015, Magento\'s market share among the 30 most popular e-commerce platforms is about 29.8%.[2] Magento employs the MySQL/MariaDB relational database management system, the PHP programming language, and elements of the Zend Framework.[3] It applies the conventions of object-oriented programming and model-view-controller architecture. Magento also uses the entity&ndash;attribute&ndash;value model to store data.[4]</p>','field/blog/Magento-banner.png','grid','3','','12','3','3','2','1','2columns-right','Best Practice','',NULL,'Best Practice','Best Practice','2016-02-05 18:34:30','2016-03-16 04:50:17',1,1),(2,'Customer Stories','customer-stories','<p>Customer Stories&nbsp;Customer Stories&nbsp;Customer Stories&nbsp;Customer Stories&nbsp;Customer Stories&nbsp;Customer Stories</p>','field/blog/6128_VenroyCustomerStoryBlogHeader_r1v2.jpg','list','1','','','1','1','1','1','1column','Customer Stories','',NULL,'Customer Stories','Customer Stories','2016-02-05 19:33:52','2016-02-11 15:26:15',2,1),(3,'Technical','technical',NULL,'','list','3','','3','1','1','1','1','1column','Technical','',NULL,'Technical','Technical','2016-02-05 19:34:45','2016-04-04 02:12:54',0,1),(4,'Events','events',NULL,'','list','1','','3','1','1','1','1','2columns-right','Events','',NULL,'Events','Events','2016-02-05 19:36:15','2016-04-04 01:57:33',0,1),(5,'Magento News','magento-news',NULL,'','list','1','','3','1','1','1','1','2columns-left','Magento News','',NULL,'Magento News','Magento News','2016-02-05 19:38:02','2016-04-03 15:35:51',0,1),(6,'Best Practice Fashion','best-practice-fashion',NULL,'','list','1','','20','3','3','2','1','2columns-left','Best Practice','',NULL,'Best Practice','Best Practice','2016-02-13 14:53:15','2016-03-16 04:48:23',0,1),(7,'Vmegamenu','vmegamenu',NULL,'','list','1','','20','4','4','2','1','2columns-left','','',NULL,NULL,NULL,'2016-08-08 09:30:26','2016-08-08 09:30:26',0,1);
