INSERT INTO `field_blog_comment` VALUES (1,2,1,'Next youâ€™re going to say that thereâ€™s no need for dinner courses and just mash it all together.','Bao','caothebao911@gmail.com','2016-02-12 13:23:10',1,1),(2,2,2,'<p><span>I used to make my own syrup for tonic, but it can be a lot of work/stuff to store. A bartender actually suggested this, rather than going for a syrup, simply add a small amount of the bark powder to soda (in a mixing tin) and then add it to the d','bao','caothebao911@gmail.com','2016-02-12 13:23:42',1,1),(11,20,0,'What is amusing is the thumbnail for the video doesnâ€™t do justice to what this technique does. The acutal technique uses gold color glue and makes the cracks stand out and look very beautiful. This stapled repair bowl is the one the emperor didnâ€™t like an','Bao','bao@gmail.com','2016-02-12 17:40:39',1,1),(12,22,0,'This is a cool project, but donâ€™t mix it with a tub that has jets the way they did in the video. Neither Epsom salts or oil are particularly good for the internal workings of the jets.','Cao The ','caothebao@gmail.com','2016-02-13 01:00:39',1,1),(13,22,0,'Hmm, I just might have time to whip some up while my fianceeâ€™s at work tomorrow. Iâ€™ll let yâ€™all know if it goes hilariously wrong.','Cao The ','caothebao@gmail.com','2016-02-13 01:00:39',1,1),(14,22,0,'ABC','Cao The ','caothebao@gmail.com','2016-02-13 01:01:01',1,1),(16,2,0,'Good','Cao The Bao','caothebao911@gmail.com','2016-02-13 02:26:09',1,1);
