INSERT INTO `field_blog_post` VALUES (1,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','introducing-new-magento-community-initiative-magento-masters','<div class=\"field-item even\">\r\n<p>In 2015, the Magento community created over 2,500 pull requests and issues for Magento 2.0 on Github, presented over 500 talks on Magento or at Magento-centric events, produced over 100 podcast episodes centered around Magento, organized conferences and meetups in over 24 different countries, wrote three books about Magento, contributed to official product documentation, wrote countless blog posts to raise awareness and education and answered thousands of questions on both <a href=\"http://magento.stackexchange.com/\" target=\"_blank\">StackExchange</a> and the <a href=\"https://community.magento.com/\" target=\"_blank\">Magento Forums</a>.</p>\r\n<p>We truly have an amazingly prolific and active community. Thank you!</p>\r\n<p>I&rsquo;m incredibly excited that today, at MagentoLive France, Mark Lavelle announced a formal program called Magento Masters to recognize our top individual contributors.</p>\r\n<p>Today&rsquo;s announcement is the culmination of over six months of research and strategic planning to develop an initiative that elevates our most active community members, recognizes them for their contributions, and empowers them to help others learn more about the Magento platform and to succeed in our ecosystem.</p>\r\n<p><strong>Types of Magento Masters</strong><br /> There are three types of individuals selected to be Magento Masters:</p>\r\n<ul>\r\n<li>\r\n<p><strong>Makers:</strong> Makers are frequent contributors valued by Magento and other community members. They actively engage with others in the Magento Community, sharing ideas, insights, and constructive feedback.</p>\r\n</li>\r\n<li>\r\n<p><strong>Mentors: </strong>Mentors are top contributors to the Magento Community who are highly active educating others and developing resources for them. They have proven expertise on building successful Magento implementations.</p>\r\n</li>\r\n<li>\r\n<p><strong>Movers:</strong> Movers are Magento&rsquo;s top advocates and ecosystem thought leaders who have demonstrated their expertise in driving innovation through Magento solutions. They are influencers in the industry in delivering best-of-class Magento implementations and advocate for Magento at industry events.</p>\r\n</li>\r\n</ul>\r\n<p><strong>Rewards &amp; Benefits</strong><br /> In addition to formal recognition at Magento&rsquo;s annual Imagine conference, other benefits may include:</p>\r\n<ul>\r\n<li>\r\n<p>Invitations to special events</p>\r\n</li>\r\n<li>\r\n<p>Involvement in community feedback opportunities</p>\r\n</li>\r\n<li>\r\n<p>Discounts on events and certifications</p>\r\n</li>\r\n<li>\r\n<p>Quarterly Magento Masters calls with the Magento team</p>\r\n</li>\r\n<li>\r\n<p>Recognition online and at Magento branded events</p>\r\n</li>\r\n</ul>\r\n<p><strong>Selection Process</strong></p>\r\n<p>Magento Masters are selected through a rigorous selection process that takes into account Magento U certification and contributions across the community including speaking engagements, the Magento Forums, Magento StackExchange, Magento-centric events, the Magento codebase, and translations.</p>\r\n<p>A Magento Master is any individual involved in the Magento ecosystem who regularly participates in the community, is a good steward of the brand, helps to create a positive environment, and consistently adds value to the community.</p>\r\n<p>Magento Masters are selected annually, inducted and formally recognized at Magento&rsquo;s Imagine conference.</p>\r\n<p>Within the next two weeks, we will be reaching out to nominees for the 2016 Class of Magento Masters. I&rsquo;m really looking forward to introducing you to them!</p>\r\n<p>Want to set yourself up as a Magento Master for 2017? A good way to start is to get involved in our community on the <a href=\"http://community.magento.com/\" target=\"_blank\">Magento Forums</a>.</p>\r\n</div>','<p>Program to recognize and empower our most active community members</p>',1,1,'field/blog/blog2.jpg','1','1','','field/blog/blog2.jpg','1','1','','2columns-left','Introducing a New Magento Community Initiative: Magento Masters','Magento Masters','Program to recognize and empower our most active community members','','eCommerce Forums, Experts',0,'2016-02-05 00:00:00','2016-10-31 03:11:49',1),(2,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','b2c-fashion-brand-launches-magento-20-site-8-weeks','<div class=\"field-item even\">\r\n<p><strong><em>New site improved site-wide conversion by 38% and mobile conversions by 60%&nbsp;</em></strong></p>\r\n<p><a href=\"https://www.venroy.com.au/\" target=\"_blank\">Venroy </a>is a boutique brand specializing in male beach resort wear inspired by the Australian beach lifestyle. They have built a successful wholesale business in the US and Europe, but their long-term strategy is to build an online presence that drifield consumer direct purchases worldwide.</p>\r\n<p>Venroy started selling through major retailers like Nordstrom&rsquo;s and high-end hotel boutiques. The company quickly lost control of their brand and customer experience as they tried to fit into an existing supply chain model. Their initial website was built on older technology and highlighted their partner boutiques to generate the wholesale business. Based on the confines of the wholesale business model, Venroy made a strategic shift to focus solely on a consumer direct model. Core to this strategy are their new online and physical stores.</p>\r\n<p>Their existing site was difficult to manage and maintain and couldn&rsquo;t scale to support their online growth. &nbsp;The team couldn&rsquo;t create the kind of brand experience they wanted given the lack of flexibility of their existing platform including limited ability to customize features. They knew they needed a new site before the busy summer season. And they needed it fast.</p>\r\n<p>The new site, built on Magneto 2.0, is consumer focused with the goal of getting website visitors to buy direct online or through their new physical store. Magento 2.0 gave them complete control over the shopping experience and lets them tell their story and communicate directly with customers. Critical to the project was a time-to-market requirement to have the site live to launch Venroy&rsquo;s summer collection.<br /> <br /><br /></p>\r\n<p>&ldquo;Magento 2 has played an important role in helping us reclaim our brand and reconnect with our customers. With a production schedule of only 8 weeks, we were able to use much of Magento&rsquo;s capabilities &lsquo;out of the box&rsquo; to deliver a unique, mobile optimized brand experience. Magento has transformed our business and delivered exceptional results from the get go,&ldquo; said Sean Venturi, co-founder of Venroy.</p>\r\n<p>Venroy selected Magento based on a strategic recommendation from Magento Gold Solution Partner, <a href=\"http://partners.magento.com/partner_locator/partner_details.aspx?id=92954\" target=\"_blank\">Netstarter</a>. Venroy needed a scalable solution that could drive business growth and support their transition to a B2C model. The Netstarter team recommended Magento 2.0 because it supported all of the key project requirements &lsquo;out of the box&rsquo;, and the solution could be delivered with minimal customization to the core code.</p>\r\n<p><em><img src=\"https://magento.com/sites/default/files/images/venroy-pdp%20770x433.jpg\" alt=\"\" width=\"770\" height=\"433\" /></em></p>\r\n<p>&nbsp;</p>\r\n<p>It was important that the new platform allowed Venroy to implement a completely customized design interface that captured their brand identity and gave them the flexibility to easily and cost-effectively make updates for seasonal collections. They were able create this mobile-friendly, custom look fast by leveraging Magento 2.0&rsquo;s responsive design reference theme and flexible frontend framework.</p>\r\n<p>Magento 2.0 was easy for Venroy to customize in other ways. The modular codebase supported efficient implementation of custom modules for Venroy&rsquo;s loyalty and referral programs. Strategic integrations with key services such as Braintree (payment processing), and Dotmailer (marketing automation) were also easily implemented and configured.</p>\r\n<p>They also used the optimized checkout process included in Magento 2.0 to eliminate unnecessary steps and streamline the user journey. In fact, the new checkout has driven higher conversion rates and the post purchase account creation feature has helped increase the number of registered customers.</p>\r\n<p>Magento 2.0&rsquo;s mature cache implementation with Varnish delivered fantastic performance with minimal configuration. The touch-friendly Admin interface was a welcomed addition as the team frequently accesses the backend via a mobile device to process orders and perform urgent content management. &nbsp;</p>\r\n<p><strong>Since launching the new site in November 2015, Venroy has experienced some encouraging results:</strong></p>\r\n<ul>\r\n<li>\r\n<p>38% increase in the site wide conversion rate</p>\r\n</li>\r\n<li>\r\n<p>60% increase in the mobile conversion rate</p>\r\n</li>\r\n<li>\r\n<p>40% decrease in the average page load times</p>\r\n</li>\r\n<li>\r\n<p>Over 50% increase in the Google PageSpeed Insights score</p>\r\n</li>\r\n</ul>\r\n<p>The ability for Venroy to leverage so many built-in features enabled them to create a powerful and compelling online experience in about 2 months &ndash; in plenty of time for the summer sales.</p>\r\n</div>','<p>New site improved site-wide conversion by 38% and mobile conversions by 60%</p>',1,1,'field/blog/blog1.jpg','2','2','','field/blog/blog1.jpg','2','2','','2columns-left','B2C Fashion Brand Launches Magento 2.0 Site in 8 Weeks','<p>New site improved site-wide conversion by 38% and mobile conversions by 60%</p>','New site improved site-wide conversion by 38% and mobile conversions by 60%','','Experts, Magento 2',20,'2016-02-05 00:00:00','2016-10-31 03:11:55',1),(3,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','byredo-delivers-experiences-unique-their-fragrances','<div class=\"field-item even\">\r\n<p><strong><em>eCommerce transactions and mobile conversions jump over 30% &amp; AOV vaults 160% after implementing Magento 2.0</em></strong></p>\r\n<p><a href=\"http://byredo.com/\" target=\"_blank\">Byredo</a> is a Stockholm-based fragrance house featuring perfume, body care, home fragrances and accessories. Byredo is wholly owned by Manzanita Capital, a venture capital firm infieldting in home and beauty brands.</p>\r\n<p><a href=\"http://www.manzanitacapital.com/\" target=\"_blank\">Manzanita Capital</a> was at a technological crossroads. Each of their portfolio brands was considering replatforming their eCommerce solution. The team standardized their approach on Magento 2.0 in order to improve cost efficiency and leverage development efforts across their portfolio.</p>\r\n<p>Manzanita Capital chose Byredo as the Beta site for Magento 2.0 based on their innovative business model and brand identity. Their existing platform was cumbersome and kept them from conveying their unique brand style effectively. The company needed an eCommerce platform that could scale to support their global expansion, and they weren&rsquo;t confident that their current platform could keep up. As with the other portfolio companies, eCommerce will be a main sales channel driving future Byredo revenue. Having a scalable and flexible platform that enabled them to create a differentiated global brand experience was critical for their business.</p>\r\n<p>Manzanita Capital and Byredo looked for a platform that could handle the complexity of multiple brands in multiple countries all running on a common backend. Under the leadership of Gold Solution Partner, <a href=\"http://partners.magento.com/partner_locator/partner_details.aspx?id=92862\" target=\"_blank\">Session Digital Ltd</a>., the team went through an extensive RFP process. They evaluated Demandware, and Hybris but found these solutions too big, too expensive and not nearly as flexible as Magento 2.0.</p>\r\n<p>The availability of a modern tech stack and code base, responsive design templates and efficient libraries, gave the team the flexibility they needed to design and deliver unique shopping experiences for each brand.&nbsp; The &ldquo;out-of-the box&rdquo; enterprise performance and scalability clearly supported their anticipated growth.</p>\r\n<p><img style=\"margin: 10px;\" src=\"/sites/default/files/images/Byredo%20Homepage%20770x513.jpg\" alt=\"\" /></p>\r\n<p>&ldquo;Magento 2.0 allows us to spend time on creative rather than code. The functionality available out-of-the-box was easy to learn and work with. We can leverage the back-end platform across our portfolio while still delivering unique customer experiences for each brand,&rdquo; said Rob Bostock, Director of Technology for SpaceNK (a Manzanita Capital portfolio company) and the driving force behind the move to Magento 2.0.</p>\r\n<p>The infieldtment in Magento 2.0 positioned the company for the future, as they started with the newest technology and were confident of the upgrade path. The entire project including design, development, build and testing was completed in three-and-a-half months allowing Byredo to launch in advance of the busy holiday shopping season.&nbsp;<br /> <br /> <img style=\"width: 770px; height: 514px; margin: 10px;\" src=\"/sites/default/files/images/Byredo%20Mobile%20770x514.jpg\" alt=\"\" /></p>\r\n<p>The impact of the new site has been significant. Year-over-year (December 2014 to December 2015), it showed an increase in eCommerce transactions of more than 30% while the average order value has jumped 160%. Plus, total mobile sessions have gone up by more than 50% and the conversions are up by more than 30%.</p>\r\n<p>Ahhh&hellip;the sweet smell of success.</p>\r\n<p><span style=\"font-family: OpenSansBold;\">Hear more about Magento 2.0 from Byredo&rsquo;s Solution Partner, Session Digital:</span></p>\r\n<p><iframe src=\"https://www.youtube.com/embed/yA3XFJ49P9w?list=PLemW25-IIsdvqGhsMXXkW66-P_fjU8X88\" frameborder=\"0\" width=\"770\" height=\"433\"></iframe></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>','<p>eCommerce transactions and mobile conversions jump over 30% &amp; AOV vaults 160% after implementing Magento 2.0</p>',1,1,'field/blog/blog4.jpg','1','1','','field/blog/blog4.jpg','1','1','','2columns-left','Byredo Delivers Experiences as Unique as their Fragrances','eCommerce transactions and mobile conversions jump over 30% & AOV vaults 160% after implementing Magento 2.0','eCommerce transactions and mobile conversions jump over 30% &amp; AOV vaults 160% after implementing Magento 2.0','','magento2',10,'2016-02-05 00:00:00','2016-10-31 03:11:43',1),(4,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','retail-spotlight-role-digitization-growth-middle-market-companies','<div class=\"field-item even\">\r\n<p>Hot off the presses for 2016, a joint study from The National Center for the Middle Market and Magento Commerce reveals that digitization remains a chief concern for businesses.</p>\r\n<p>The research, &ldquo;How Digital Are You?,&rdquo; found that the fastest-growing middle market firms place a greater emphasis on digitization than their similar-sized counterparts. The data also highlighted the shifting focus of mid-market players&rsquo; digitization investments, marking a departure from the back office and operations-focused spending that has defined digitization activities in the past.</p>\r\n<p>Unique among participating industries, the retail and wholesale sector has experienced a sea change led by technology and shifting consumer expectations. On the heels of NRF last week, here are a few unique insights for the retail industry:</p>\r\n<ul>\r\n<li>\r\n<p><strong>Mounting pressure to digitize retail and wholesale trade</strong><br /> As brick-and-mortar stores struggle to keep up with strong online competition, the pressure to digitize has never been greater. While more than three quarters (78 percent) of retail and wholesale trade businesses say digitization is important relative to other business priorities, retail lags other sectors in the priority it places on digitization who rate digitization importance at 90 to 93 percent.&nbsp;</p>\r\n</li>\r\n<li>\r\n<p><strong>Bogged down by complexity and slow progress</strong><br /> Not surprisingly, retailers and wholesalers were more likely to report a slower pace of digitization than other industries (37 percent). Integrating with legacy systems combined with a failure to prioritize the implementation of digitization efforts contribute to the problem. While the average payoff timeframe for digitization projects is three years, many firms cited waiting up to five years or more to realize a return on their investment.</p>\r\n</li>\r\n<li>\r\n<p><strong>Wake up and smell the innovation</strong><br /> The study revealed that most retail digitization investment goes towards back office operations (e.g. accounting) and facilitating current business (sales, customer service, marketing and logistics), with only 8 percent currently being invested in innovation projects which are important drivers of future growth and profitability for these companies. As the barriers to embracing next-era technologies dissipate, retailers will need to step up their game or get left behind.&nbsp;</p>\r\n</li>\r\n<li>\r\n<p><strong>New Year, New Me for Retail</strong><br /> The data revealed that the business services and technology sector had the greatest percentage (50 percent) of companies that consider themselves digitally advanced, while more than one third of retailers (35 percent) feel somewhat or very far behind on digital readiness, leading 29 percent to increase their investment in digitization projects in the next 12 months.</p>\r\n</li>\r\n</ul>\r\n<p>\"Clearly, the study validates that improving digitization is important to every industry in the digital age and that technology is rewriting the rules of the game. Businesses that are complacent or just average in this area will get left behind,\" said Peter Sheldon, Chief Strategy Officer, Magento Commerce. \"To keep pace, companies must take necessary steps to address key digitization barriers and move quickly to successfully adopt next-era digital tools. In doing so, these businesses secure not only continued relevance, but also superior returns and growth.\"</p>\r\n<p>To learn more about the study:</p>\r\n<ul>\r\n<li style=\"margin-left: 0.5in;\">\r\n<p><a href=\"https://magento.com/company/press-room/press-releases/new-study-maps-role-digitization-growth-middle-market-companies\" target=\"_blank\">Read the press release</a></p>\r\n</li>\r\n<li style=\"margin-left: 0.5in;\">\r\n<p><a href=\"https://magento.com/resources/fastest-growing-middle-market-study\" target=\"_blank\">Download the full report</a>&nbsp;</p>\r\n</li>\r\n</ul>\r\n</div>','<p>The research, &ldquo;How Digital Are You?,&rdquo; found that the fastest-growing middle market firms place a greater emphasis on digitization than their similar-sized counterparts. The data also highlighted the shifting focus of mid-market players&rsquo; digitization investments, marking a departure from the back office and operations-focused spending that has defined digitization activities in the past.</p>',1,1,'field/blog/blog3.jpg','1','1','','field/blog/blog3.jpg','1','1','','empty','Retail Spotlight: the Role of Digitization in Growth of Middle Market Companies',NULL,'A joint study from Magento Commerce and The National Center for the Middle Market','Retail Spotlight: the Role of Digitization in Growth of Middle Market Companies','Analytics, Experts, ',0,'2016-02-04 00:00:00','2016-10-31 03:11:38',1),(6,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','retail-trends-2016-death-knell-brick-and-mortar-while-mobile-takes','<div class=\"field-item even\">\r\n<p><em>Originally posted on <a href=\"http://multichannelmerchant.com/ecommerce/retail-trends-2016-death-knell-brick-mortar-mobile-takes-16012016/\" target=\"_blank\">Multichannel Merchant</a>. Follow Peter Sheldon on Twitter <a href=\"https://twitter.com/peter_sheldon\" target=\"_blank\">@PETER_SHELDON</a></em></p>\r\n<p>With 2016 upon us, it&rsquo;s a good time to look ahead to four key trends gathering momentum in the New Year, and look at what drastic changes the industry will see and what cool new technologies shoppers will be able to take advantage of at scale (don&rsquo;t worry, we won&rsquo;t mention drones!).</p>\r\n<p><strong style=\"line-height: 1.6em;\">Brick &amp; Mortar is Dead! Long live brick &amp; mortar!</strong></p>\r\n<p>Many are interpreting the data from this past holiday season as a further indicator of the imminent demise of brick and mortar stores, and in some ways that&rsquo;s true. We all know that brick and mortar giants are feeling the crunch. They are increasingly unable to compete with the convenience and competitive pricing environment of the online shopping experience. Now even the age old physical advantages of face-to-face product expertise and same day availability have been battered by online content superiority and same day shipping options.</p>\r\n<p><span style=\"line-height: 1.6em;\">Doom and gloom aside, some bright spots remain. Industries like apparel require a customer to be able to try on, touch, feel, and interact with the products they&rsquo;re buying. No easy return policy, no pre-labeled shipping packaging or sizing intelligence platform will ever fully replace that.</span></p>\r\n<p><span style=\"line-height: 1.6em;\">But that doesn&rsquo;t mean apparel isn&rsquo;t going through its own transformation, and it&rsquo;s one that will only heat up in 2016. More and more, apparel brands are embracing technologies that blend the best of in-store and online experience, from in-store pick-up to connected fitting rooms and digitally-enabled concierge services. The boldest seek to combine multiple new-to-market innovations to completely digitize the in-store buying experience&mdash;</span><a style=\"line-height: 1.6em;\" href=\"https://magento.com/videos/imagine/rebecca-minkoff\">Rebecca Minkoff</a><span style=\"line-height: 1.6em;\"> is a great example&mdash;and make the soft goods stores of today look nothing like where your mother shopped.</span></p>\r\n<p><strong style=\"line-height: 1.6em;\">The Mobile Tipping Point</strong></p>\r\n<p>While it seems every holiday season for the last five years has been proclaimed &ldquo;the year of mobile,&rdquo; in 2015 mobile transaction volumes really started to live up to the hype. In the face of declining in-store traffic, mobile sales <a href=\"http://www.newsweek.com/smartphones-save-black-friday-sale-2015-400058\">accounted for </a><a href=\"http://www.newsweek.com/smartphones-save-black-friday-sale-2015-400058\">36 percent</a> of all Black Friday purchases.</p>\r\n<p><span style=\"line-height: 1.6em;\">The mobile experience today is significantly superior than years past, but what are the forces driving consumer confidence in transactions on mobile devices?</span></p>\r\n<ul>\r\n<li>\r\n<p><strong>Big screens rule.</strong> As consumers go through yet another handset replacement cycle, larger screen real-estate (thank you Tim Cook for the iPhone 6 &amp; 6+) has given savvy mobile web developers more creative freedom to pack in more visible content without sacrificing usability on these devices.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p><strong>Higher bandwidth becomes (almost) ubiquitous.</strong> For those North Americans living near a metropolitan core, access to 4G bandwidth is rapidly becoming a commodity. Combined, this access to fast content delivery with mobile web acceleration technologies like Front End Optimization (FEO) and experimentation with new mobile web technologies like single page applications (SPA&rsquo;s) and many of todays mobile web experiences now rival the performance of their desktop forefathers.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p><strong>HTML form controls quietly die.</strong> An obsession for mobile first, touch and gesture optimized experiences have led mobile developers to quietly put to rest HTML controls like the radio button, checkbox and dropdown list. These venerable controls have served us well, but on mobile there is simply a better way to use vector graphics and touchable icons to enable frictionless navigation and selection.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p><strong>Checkout &amp; payment friction dissipates. </strong>Online retailers are investing in increasingly clever ways to simplify and automate the mobile checkout process from social authentication, Google maps powered address autocomplete, and the removal of all but the most critical field entry forms. Combined with the rollout of mobile checkout innovations such as PayPal OneTouch and Apple Pay, making a purchase on mobile is getting easier than ever.</p>\r\n</li>\r\n</ul>\r\n<p><span style=\"line-height: 1.6em;\">Over the next two years, we&rsquo;re well on track to reach a new mobile tipping point where fifty percent of all commerce transactions take place on a mobile device. This surge in mobile commerce adoption will bring about a paradigm shift in the way developers approach user experience design. Historically, responsive design was used to make the desktop experience accessible and adequately usable across an increasingly diverse mobile device universe. In 2016, we will see new &ldquo;mobile first&rdquo; obsessions emerge, where &ldquo;usable&rdquo; no longer cuts it. Instead, this obsession for creating highly optimized mobile first experiences will make the mobile experience the de facto starting point. Responsive web design (RWD) will be then be used in an inverse manner to make next generation mobile experiences &ldquo;usable&rdquo; on the desktop.</span></p>\r\n<p><strong style=\"line-height: 1.6em;\">Social Selling, the Engine of Discovery</strong></p>\r\n<p>As customers embrace mobile&mdash;and as retailers increasingly capitalize on social media as a powerful channel for customer engagement&mdash;we&rsquo;ll see social media become the default starting point for the retail journey. For retailers, this means greater investment in technologies like <a href=\"https://business.pinterest.com/en/blog/new-merchants-and-platforms-buyable-pins\">Pinterest&rsquo;s Buyable Pins</a>. What may have previously been an afterthought in a company&rsquo;s marketing strategy will come to the foreground as retailers create deep, curated content to attract, engage and retain loyal customers. Early adopters will be rewarded; those who fail to catch on will find themselves behind and hastily trying to put together a social content strategy.</p>\r\n<p><strong style=\"line-height: 1.6em;\">Virtual Reality: Not Just for Spotty Teenagers</strong></p>\r\n<p>In 2016, Oculus Rift will for sure top birthday wish lists of almost every male between the age of seven and 22, but virtual reality holds an exciting promise beyond a new (and slightly bizarre) ski goggle fashion craze. While brick and mortar retailers will integrate more digital experiences into their stores, branded manufacturers will tap virtual reality to enable almost &lsquo;real world&rsquo; like product discovery and engagement experiences from the home. While not every household will invest in expensive VR hardware like Oculous Rift, the emergence of more accessible and affordable virtual reality technology (like the Samsung gear headset) and even Google cardboard wearables will make virtualized product discovery an increasingly valuable and rewarding experience for consumers.</p>\r\n<p><span style=\"line-height: 1.6em;\">The automotive industry is a great example. Buying a car has always been a harrowing process that required multiple visits to car dealerships to test drive a car and choose optional features followed by hours of haggling and paperwork to complete the transaction. And while companies like </span><a style=\"line-height: 1.6em;\" href=\"https://www.youtube.com/watch?v=wYntsIIn9xY&amp;feature=youtu.be&amp;list=UU9sQv85HzNIwvuMDTGp2NCw\">Rockar and Hyundai</a><span style=\"line-height: 1.6em;\"> are reimagining the experience with the customer at the center, car manufacturers like </span><a style=\"line-height: 1.6em;\" href=\"https://www.youtube.com/watch?v=ODTZ709v90k\">Volvo</a><span style=\"line-height: 1.6em;\"> are already using VR mobile apps to allow potential buyers to take a virtual test drive.</span></p>\r\n<p><strong style=\"line-height: 1.6em;\">The 2016 Test: Keeping Pace With Customer Expectations</strong></p>\r\n<p>Undoubtedly, 2016 will bring a sea change to retail, from the shifting mobile paradigm to experimentation with virtual reality in the shopping experience. But before we get our shovels ready to bury brick and mortar for good, we&rsquo;ll need to keep any schadenfreude in check: At today&rsquo;s pace of technology innovation and change, the next disruption could be closer than we think. The spoils of the New Year will go to those who embrace the adage &ldquo;think big, act small, fail fast and learn quickly&rdquo; because in 2016, customer expectations will wait for no one.</p>\r\n<p>&nbsp;</p>\r\n</div>','<p><span>Peter Sheldon\'s predictions for 2016.</span></p>',1,1,'field/blog/blog2.jpg','1','1','','field/blog/blog2.jpg','1','1','','2columns-right','Retail Trends 2016: Death Knell for Brick and Mortar, While Mobile Takes Off','<p><span>Peter Sheldon\'s predictions for 2016.</span></p>','Peter Sheldon\'s predictions for 2016.','','Experts',12,'2016-02-01 00:00:00','2016-10-31 03:11:35',1),(7,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','sol-magento-20-perfect-fit','<div class=\"field-item even\">\r\n<p><strong>Online revenue grew 104% during the first six week period, with mobile accounting for 60% of total online revenue.</strong><br /> Sisters Jeanie and Cindy have been profitably running <a href=\"http://www.solgirl.com/\" target=\"_blank\">SOL Lingerie</a> for 18 years. They saw an opportunity to grow their business and rebrand the online experience. The goal for the new brand was to continue growing the business beyond the store by creating an online version of their fun, unique and personal in-store experience. Designing the new website was about giving customers what they wanted&mdash;a convenient and personal experience. The company needed a platform that could handle the demands of a very stylized site design, seamlessly scale to support their projected growth, and provide the added functionality their vision will require over time.</p>\r\n<p><img style=\"width: 428px; height: 310px; margin: 10px; float: left;\" src=\"/sites/default/files/images/6040_M2BetaMerchantSOLCustomerStoryBlogImages_Images_r1v1_1.png\" alt=\"\" /></p>\r\n<p>SOL partnered with Magento 2 Trained Solution Partner&nbsp;<a href=\"http://partners.magento.com/partner_locator/partner_details.aspx?id=92977\" target=\"_blank\">Guidance</a>&nbsp;to bring their vision to life. SOL was using Magento Community Edition, but wanted a more sophisticated platform that could scale to support future growth of their online business, and allow significant levels of personalization and social media integration to help deliver their unique online experience. When Guidance recommended upgrading to Magento Enterprise Edition 2.0, the team was all in.</p>\r\n<p>&ldquo;We quickly realized that growing the business meant growing the online business. Magento opens up the possibility of using technology to provide customers with the same fun SOL experience online as they get instore. The value of the online customer experience is what it&rsquo;s all about. That&rsquo;s what will drive our growth,&rdquo; says Jeanie Peterson, Co-Founder of SOL.</p>\r\n<p>The architecture, performance and scalability of Magento 2.0 allowed SOL to hit the ground running, handle the increased traffic and number of SKUs, and positioned them to be more significant eCommerce player in their industry. By leveraging the out-of-box responsive design theme, they improved conversions on mobile devices as well as Google search rankings. In fact, mobile and tablet devices accounted for 48% of all site traffic in November and December 2015, and 27% of all eCommerce conversions.</p>\r\n<p><img style=\"margin: 10px; float: right;\" src=\"/sites/default/files/images/6040_M2BetaMerchantSOLCustomerStoryBlogImages_Images_r1v1_2.png\" alt=\"\" /></p>\r\n<p>The company was able to take advantage of the extensive ecosystem of solutions available for Magento 2.0 to deliver exactly the experiences their customers want. Everything from integration with their POS system, to appointment scheduling and visual order history was available through partner-developed extensions. They leveraged the native Magento CMS capabilities to manage rich content that would normally be in a non-eCommerce platform like Drupal for their&nbsp;<a href=\"https://www.solgirl.com/designers/marie-jo\" target=\"_blank\">Designer Landing Pages</a>, <a href=\"https://www.solgirl.com/sol-story\" target=\"_blank\">The SOL Story</a>, and <a href=\"https://www.solgirl.com/meet-our-fitters\" target=\"_blank\">Meet the Fitters </a>Biographies. This, plus the new Admin UX, made it easier for them to manage all their content, as well as customer and order information, which is a big advantage for a company of 25 employees.</p>\r\n<p>The completely redesigned site went live on October 14, 2015<span style=\"font-family: OpenSansRegular, sans-serif; font-size: 15px; line-height: 28px;\">&mdash;</span>taking only 90 days from start to finish. Online revenue, including mobile, grew approximately 104% during the first six week period, with mobile devices representing 60% of the total online revenue (more than double the industry average of about 27%). SOL has never experienced this type of rapid sales growth in its 18-year history. With the help of Guidance Solutions, Inc., SOL expects to gain significant cost efficiencies and productivity enhancements with upcoming Magento 2.x releases based on their early experience and learnings with <a href=\"https://magento.com/products/enterprise-edition\" target=\"_blank\">Magento Enterprise Edition 2.0</a>.</p>\r\n</div>','<p>The goal for the new brand was to continue growing the business beyond the store by creating an online version of their fun, unique and personal in-store experience. Designing the new website was about giving customers what they wanted&mdash;a convenient and personal experience. The company needed a platform that could handle the demands of a very stylized site design, seamlessly scale to support their projected growth</p>',1,1,'field/blog/blog1.jpg','2','1','','field/blog/blog1.jpg','1','1','','1column','SOL: Magento 2.0 is a Perfect Fit','Online revenue grew 104% during the first six week period, with mobile accounting for 60% of total online revenue','Online revenue grew 104% during the first six week period, with mobile accounting for 60% of total online revenue','','Fashion,Merchants,Partners, ',10,'2016-02-05 00:00:00','2016-10-31 03:11:32',0),(8,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','usps-updates-coming-january-17','<div class=\"field-items\">\r\n<div class=\"field-item even\">\r\n<p>Several USPS changes are scheduled to go into effect on January 17, 2016. Shipping service rates are increasing (Pitney Bowes released a <a href=\"https://youtu.be/h5p_7O3dx28\" target=\"_blank\">video</a> detailing the price changes)&nbsp;and the USPS API is being updated to remove several flat rate box services and to reflect that &ldquo;Standard Post&rdquo; is being renamed &ldquo;Retail Ground.&rdquo; Magento will be including these updates in an upcoming release and patch.&nbsp;</p>\r\n<p><strong>Updated January 20, 2016:</strong></p>\r\n<p>A new patch (SUPEE-7616) is now available for Magento Enterprise and Community Editions. Additionally, the new Enterprise Edition 1.14.2.3, Enterprise Edition 2.0.1, Community Edition 1.9.2.3, and Community Edition 2.0.1 releases all include the USPS changes. The patches and releases are available from the <a href=\"https://partners.magento.com/English/?rdir=/files.aspx\" target=\"_blank\">Partner Portal</a>, <a href=\"https://www.magentocommerce.com/products/downloads/\" target=\"_blank\">My Account</a>, and <a href=\"https://www.magentocommerce.com/products/downloads/magento/\" target=\"_blank\">Community Edition Download Page</a>.</p>\r\n</div>\r\n</div>','<p>The goal for the new brand was to continue growing the business beyond the store by creating an online version of their fun, unique and personal in-store experience. Designing the new website was about giving customers what they wanted&mdash;a convenient and personal experience. The company needed a platform that could handle the demands of a very stylized site design, seamlessly scale to support their projected growth</p>',1,1,'field/blog/blog4.jpg','1','1','','field/blog/blog4.jpg','1','1','','1column-fullwidth','USPS Updates Coming January 17',NULL,'Get ready to update your code to support USPS API changes.','','Code Releases, Developers, Merchants',1,'2016-02-01 00:00:00','2016-10-31 03:11:28',0),(9,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','magento-20-architected-new-era-commerce-innovation','<div class=\"field-item even\">\r\n<p>Our next-generation platform, Magento 2.0, is built on a robust, modern architecture designed to adapt and scale to meet the challenges of the increasingly complex commerce market and to keep pace with the breakneck pace of innovation. In short, it&rsquo;s architected for change.</p>\r\n<p><span style=\"line-height: 1.6em;\">To help you understand how Magento 2.0 is designed for speed, extensibility and scalability, we&rsquo;ve prepared a </span><a style=\"line-height: 1.6em;\" href=\"http://magento.com/resources/magento-architecture\" target=\"_blank\">comprehensive white paper</a><span style=\"line-height: 1.6em;\"> covering the core principles behind the Magento 2.0 architecture. The paper provides details on how the platform has been built from the ground up to be open and flexible so merchants can bring their commerce vision to fruition even faster.</span></p>\r\n<p><span style=\"line-height: 1.6em;\">&ldquo;Magento 2 has taken areas Magento is famous for such as openness and flexibility, and amplified them. It has incorporated best practices around modularity and superior scalability,&rdquo; said Magento Chief Architect Alan Kent. &ldquo;And then it has gone further, modernizing the platform technologies and development practices including test automation and removing extension conflicts. The platform was designed with a goal to accelerate innovation, and empower developers with complete control of their implementation and full confidence and predictability in adding and developing extensions&rdquo;</span></p>\r\n<p><span style=\"line-height: 1.6em;\">Among the principles of Magento architecture covered in the whitepaper are:</span></p>\r\n<ul>\r\n<li>\r\n<p>A <strong>Modern Tech Stack</strong> based on popular, innovative PHP frameworks and coding patterns.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p><strong>Layered Product Architecture </strong>that supports the separation of visual presentation from backend business logic. This compartmentalization simplifies customization of store appearance and behavior.&nbsp; Architectural layers also provide programmers with a high-level model for understanding the optimal placement of features and code in a complex system.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p><strong>Modular Codebase </strong>to offer limitless flexibility and to enable fine grain customizations and make it easier to add or replace functionality as merchant needs change</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p><strong>Customizable Store Branding </strong>and theming to quickly create and painlessly maintain site variations for seasonal campaigns or market expansions</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p><strong>Extensive and Efficient APIs</strong> to seamlessly integrate and operate at scale with any third-party solution like ERP, PIM, OMS, CRM, CMS, promotions and taxes.</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p><strong>Automated and Built-in Testing</strong> to speed up the QA process for a faster time to market</p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p>And <strong>Easier Upgrades</strong> to quickly add new functionality as it becomes available with Magento&rsquo;s quarterly development cycle</p>\r\n</li>\r\n</ul>\r\n<p>To learn more about Magento&rsquo;s next-generation architecture:</p>\r\n<ul>\r\n<li>\r\n<p><a href=\"http://magento.com/resources/magento-architecture\" target=\"_blank\">Download the full white paper</a></p>\r\n</li>\r\n</ul>\r\n<ul>\r\n<li>\r\n<p>View a short <a href=\"https://vimeo.com/145947978#at=1\" target=\"_blank\">video about Magento architecture</a> or <a href=\"https://vimeo.com/146412648#at=2\" target=\"_blank\">performance and scalability</a></p>\r\n</li>\r\n</ul>\r\n</div>','<p>Our next-generation platform is built on a robust, modern architecture designed to adapt and scale</p>',1,1,'field/blog/blog3.jpg','1','1','','field/blog/blog3.jpg','1','1','','1column','Magento 2.0 Architected for the New Era of Commerce Innovation','Our next-generation platform is built on a robust, modern architecture designed to adapt and scale','Our next-generation platform is built on a robust, modern architecture designed to adapt and scale','','Business News,Magento 2,Products',10,'2016-02-05 00:00:00','2016-10-31 03:11:26',0),(10,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','home-retail-priorities-and-developments-2016','<div class=\"field-item even\">\r\n<p>It&rsquo;s been a busy few months for home retailers with consumers driving peak trading periods across the likes of Black Friday and Cyber Monday. But with 2016 right round the corner, retailers should be taking key learnings from these now-annual events and strategising on how to best manage their channels to create the best experience possible for customers next year.</p>\r\n<p><span style=\"line-height: 1.6em;\">In 2016 everything points to connectedness, convenience and service &ndash; all of which a good retailer knows in their bones. As such, retailers need to ensure they are addressing three key areas:</span></p>\r\n<ol>\r\n<li>\r\n<p><strong>Be Visible on the Right Channels</strong> &ndash; using the appropriate digital tools will help make retailers the first choice for customers. Black Friday 2015 was a real example where consumers clearly chose online channels over instore.</p>\r\n</li>\r\n<li>\r\n<p><strong>Simplify the Customer Journey</strong> &ndash; making the user journey as simple as possible to navigate and complete, from the in-store experience, to mobile, tablet, and website.</p>\r\n</li>\r\n<li>\r\n<p><strong>Ensure a Fair and Efficient</strong>&nbsp;<strong>R</strong><strong>eturns and Complaint Resolution Process </strong>&ndash; so as to protect the brand&rsquo;s reputation with the increase in social sharing.</p>\r\n</li>\r\n</ol>\r\n<p><span style=\"line-height: 1.6em;\">In the home retail industry there will always be products customers will want to see and interact with before they commit to a purchase and, as such, the multichannel capabilities of the home goods market are currently fairly low in comparison to other categories. But there is scope to make improvements and technology will play a significant part in bridging the on and offline worlds for a better customer experience.</span></p>\r\n<p><span style=\"line-height: 1.6em;\">Next year the technology we expect to see take prominence include:</span></p>\r\n<ol>\r\n<li>\r\n<p><strong>Beacons &ndash; </strong>Useful for tracking the customer&rsquo;s journey around the shop, identifying any pain points which prevent a sale, or alerting retailers when customers arrive, beacons can provide invaluable insights of consumer behaviour. They are also a handy tool when retailers are unable to display their full range of products in store. By placing beacons on products, the customer can bring up the whole range of product information and variations to improve their purchasing decisions.</p>\r\n</li>\r\n<li>\r\n<p><strong>Clienteling Apps &ndash; </strong>By informing retailers of consumers&rsquo; purchase history and the potential for cross and up selling, as well as when purchases take place, staff can provide a personalised experience to loyal customers.</p>\r\n</li>\r\n<li>\r\n<p><strong>Click and Collect </strong>&ndash; Enhancing the pick-up experience by encouraging retailers to think about the lay out of their store for when customers pick up goods provides an opportunity for customers to find other items of interest and for the retailer to up sell products.</p>\r\n</li>\r\n</ol>\r\n<p><span style=\"line-height: 1.6em;\">2016 poses an exciting time for retailers, with the evolution of technologies enabling them to provide an optimum customer experience. However in order to provide the experience consumers desire, retailers need to focus in on their needs and apply those technologies that best match their circumstances, making their shopping experience more personalised, efficient and synchronised, allowing customers to shop between the different channels as they please.</span></p>\r\n<p><em style=\"line-height: 1.6em;\"><img style=\"width: 140px; height: 140px; margin: 10px; float: left;\" src=\"/sites/default/files/images/Iain%20Devine%2C%20Commerical%20Director%2C%20Salmon.jpg\" alt=\"\" />Iain Devine is Commercial Director at global digital commerce consultancy <a href=\"https://www.salmon.com/en/\" target=\"_blank\">Salmon</a>, overseeing its marketing, strategic business partnerships and sales. He also contributes to Salmon&rsquo;s overall business strategy and develops new offerings to both existing and new clients.</em></p>\r\n</div>','<p>Key learnings from Black Friday and Cyber Monday to create the best customer experience across all channels</p>',1,1,'field/blog/blog2.jpg','1','1','','field/blog/blog2.jpg','1','1','','2columns-left','Home Retail: Priorities and Developments for 2016','Key learnings from Black Friday and Cyber Monday to create the best customer experience across all channels','Key learnings from Black Friday and Cyber Monday to create the best customer experience across all channels','','Customer Experience',0,'2016-02-01 00:00:00','2016-10-31 03:11:23',0),(13,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','pioneers-magentopartner-audit','<div class=\"field-item even\">\r\n<p>At MagentoLive Australia, we <a href=\"http://magento.com/company/press-room/press-releases/magento-commerce-develops-deeper-technology-partnerships\" target=\"_blank\">announced</a> the Partner Audit, a rigorous process that provides standards and guidelines to validate the quality of product integrations with Magento Commerce Solutions. The process involves documentation review and a formal Code Audit that adheres to Magento Expert Consulting Group best practices, development guidelines and auditing tools. The Code Audit verifies that extensions are developed according to Magento standards and best practices for coding structure, performance, and scalability.</p>\r\n<p><span style=\"line-height: 1.6em;\">The end goal of this program is to ensure a higher level of confidence and satisfaction with merchants and solution partners, while providing market differentiation for Magento technology partners and developers.</span></p>\r\n<p><span style=\"line-height: 1.6em;\">Over the last few months, Magento has worked with a handful of select providers, not only to audit their extensions, but to also be able to develop a more smooth and streamlined partner certification program. Magento is extremely grateful for the efforts of these pioneers. They are helping to shape the future of this program and have put in work that will benefit future providers who seek certification.</span></p>\r\n<p><strong style=\"line-height: 1.6em;\">Among the audited providers are:</strong></p>\r\n<p><strong>1.<a href=\"http://www.magentocommerce.com/magento-connect/developer/aheadWorks\" target=\"_blank\">aheadWorks</a></strong><br /> <span style=\"line-height: 1.6em;\">aheadWorks&rsquo; </span><a style=\"line-height: 1.6em;\" href=\"http://www.magentocommerce.com/magento-connect/ajax-cart-pro-by-aheadworks-3157.html\" target=\"_blank\">Ajax Cart Pro</a><span style=\"line-height: 1.6em;\"> was the first extension audited by Magento and was developed for effortless adding and removing products from the shopping cart. aheadWorks has developed a wide range of modules extending native Magento functionality: sales motivation, user experience, social networking integration, customer care and support, content improvement, analytics, administration, marketing. The company is officially recognized as Magento Silver Partner.</span></p>\r\n<p><strong>2.<a href=\"http://www.magentocommerce.com/magento-connect/hiconversion-web-analytics-customer-experience-optimization.html\" target=\"_blank\">HiConversion</a></strong><br /> <span style=\"line-height: 1.6em;\">HiConversion is a Magento connector that enables the use of all customer experience analytics, web analytics, testing, targeting, personalization, and customer experience optimization capabilities of the HiConversion product suite. This one-time integration saves merchants from custom tagging and other implementation pains associated with traditional web analytics, testing, and personalization solutions. HiConversion is a Magento Silver Partner.</span></p>\r\n<p><strong>3.<a href=\"http://www.magentocommerce.com/magento-connect/order-manager-by-fooman.html\" target=\"_blank\">Fooman</a></strong><br /> <span style=\"line-height: 1.6em;\">Fooman has three audited extensions. Their </span><a style=\"line-height: 1.6em;\" href=\"http://www.magentocommerce.com/magento-connect/order-manager-by-fooman.html\" target=\"_blank\">Order Manager</a><span style=\"line-height: 1.6em;\"> extension is available now in the Marketplace and then their next two extensions will be available for the M2 launch. Order Manager offers easy administration, customizations, and integrations. Fooman is a Magento Silver Partner.&nbsp;</span><span style=\"line-height: 20.8px;\">One of fooman&rsquo;s extensions is on&nbsp;</span><a style=\"line-height: 20.8px;\" href=\"http://www.magentocommerce.com/magento-connect/magento-2\" target=\"_blank\">http://www.magentocommerce.com/magento-connect/magento-2</a>.</p>\r\n<p><span style=\"line-height: 1.6em;\">Keep an eye out for our next blog highlighting additional audited extensions.</span></p>\r\n<p>&nbsp;</p>\r\n</div>','<p>Magento has worked with a handful of select providers to audit their extensions and develop a more smooth and streamlined partner certification program</p>',1,1,'field/blog/blog1.jpg','1','1','','field/blog/blog1.jpg','1','1','','2columns-left','Pioneers of Magentoâ€™s Partner Audit','Magento has worked with a handful of select providers to audit their extensions and develop a more smooth and streamlined partner certification program','Magento has worked with a handful of select providers to audit their extensions and develop a more smooth and streamlined partner certification program','','Partners',0,'2016-02-05 00:00:00','2016-10-31 03:11:21',0),(15,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','saving-and-reverting-positions-visual-merchandiser','<div class=\"field-item even\">\r\n<p>In this excerpt from his merchandising course, Magento expert and Magento U trainer Steve Kukla answers the question, &ldquo;Once a category has been visually merchandised, is there any way to revert it back to the original sort order that is set in the default product listing sort field?&rdquo;&nbsp;</p>\r\n<p><span style=\"line-height: 1.6em;\">Want to learn more about managing your Magento store? Take </span><a style=\"line-height: 1.6em;\" href=\"http://magento.com/training/catalog/managing-your-magento-store-16000\" target=\"_blank\">the full course</a><span style=\"line-height: 1.6em;\"> with Steve.</span></p>\r\n<p><span style=\"line-height: 1.6em;\">Follow Steve on Twitter: <a href=\"https://twitter.com/steveatmagento\" target=\"_blank\">@SteveAtMagento</a></span></p>\r\n<p><a href=\"http://magento.com/training/overview?utm_source=vismerchtrainingblog&amp;utm_medium=banner&amp;utm_campaign=magentou\" target=\"_blank\"><img style=\"width: 600px; height: 240px; margin: 10px;\" src=\"http://magento.com/sites/default/files/images/4646_Magento_U_Creative_Assets_newsletter_maize_class_r1v1%281%29.png\" alt=\"\" /></a></p>\r\n<p>&nbsp;</p>\r\n</div>','<p>Magento U trainer Steve Kukla shows you how to do it In this excerpt from his merchandising course, Magento expert and Magento U trainer Steve Kukla answers the question</p>',1,1,'field/blog/blog4.jpg','2','1','','field/blog/blog4.jpg','1','1','','1column','Saving and Reverting Positions with Visual Merchandiser','<p>Magento U trainer Steve Kukla shows you how to do it</p>','Magento U trainer Steve Kukla shows you how to do it','','Enterprise Edition, Experts, Magento U, Tips & Tricks',11,'2016-02-05 00:00:00','2016-10-31 03:12:09',0),(16,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','magentolive-australia-2015-wraps-sydney','<div class=\"field-item even\">\r\n<p>MagentoLive Australia wrapped up in Sydney November 19, and we can\'t say thank you enough to the Magento ecosystem for helping us make it a big success. For those of you who couldn\'t join us, here are some of the Partner recaps rolling in and some of the highlights featured on Twitter, including, of course, the biggest news of the event: Magento 2.0.</p>\r\n<p><strong>Partner Recaps</strong><br /> <span style=\"line-height: 1.6em;\">(More will be added as they are posted)</span></p>\r\n<p><a href=\"http://www.netz98.de/regalsprecher/magento-2-evolution-im-e-commerce/\" target=\"_blank\"><span style=\"line-height: 1.6em;\">netz98</span></a></p>\r\n<p><a href=\"http://www.dckap.com/blog/recap-magento-live-australia-2015/\" target=\"_blank\">DCKAP</a></p>\r\n<p><a href=\"http://www.balanceinternet.com.au/magento-live-australia-the-launch-of-magento-2/?utm_content=buffer44b4e&amp;utm_medium=social&amp;utm_source=twitter.com&amp;utm_campaign=buffer\" target=\"_blank\">Balance Internet</a></p>\r\n<p><strong>MagentoLive Australia on Twitter</strong></p>\r\n<div class=\"storify\" style=\"display: block; clear: left;\"><iframe id=\"header-564cf29bcffeeaf756e7f5b4\" style=\"border: none; display: block; height: 40px; overflow: hidden; position: fixed; top: 0px; width: 770px;\" width=\"100%\" height=\"240\" frameborder=\"no\" scrolling=\"no\"></iframe><iframe style=\"display: block; border: none; overflow: hidden; width: 770px; max-width: 900px; height: 10280px; min-height: 10280px; background-color: transparent;\" src=\"//storify.com/magentocommerce/mlau15/embed?border=false\" width=\"100%\" height=\"750\" frameborder=\"no\" scrolling=\"no\"></iframe><noscript>[&amp;amp;amp;amp;amp;amp;amp;lt;a href=\"//storify.com/magentocommerce/mlau15\" target=\"_blank\"&amp;amp;amp;amp;amp;amp;amp;gt;View the story \"MagentoLive Australia 2015 #MLAU15\" on Storify&amp;amp;amp;amp;amp;amp;amp;lt;/a&amp;amp;amp;amp;amp;amp;amp;gt;]</noscript></div>\r\n</div>','<p>Everything I know about cooking, I learned from my dad. Over the years, Chef Bob, as we like to call him, has created mouth-watering meals for our family to enjoy together. While he&rsquo;s spent years perfecting his pot roast, we were definitely subjected to a few less-than-appealing dinners along the way</p>',1,1,'field/blog/blog3.jpg','1','1','','field/blog/blog3.jpg','1','1','','2columns-left','MagentoLive Australia 2015 Wrasps Up in Sydneys','Big names, big announcements, and big parties: here\'s what made #MLAU15 awesome','Big names, big announcements, and big parties: here\'s what made #MLAU15 awesome','','Developers, MagentoLive, Partners, Products',17,'2016-02-05 00:00:00','2016-10-31 03:11:02',0),(17,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','retain-your-holiday-shoppers-2016','<div class=\"field-item even\">\r\n<p>Q4 is in full swing, but while you might not have even gotten around to dusting off the holiday ornaments yet, now is actually the best time to start preparing for a successful 2016! In fact, the earlier you start 2016 preparations, the better you will be positioned to leverage the traffic and subsequent data that you have gathered over Q4, allowing you to generate long-term, happy customers that return to your store long after the holiday decorations are back in storage.</p>\r\n<p><span style=\"line-height: 1.6em;\">While personalization has been a hot trend for a couple of years now, 2016 will see it move from an optional extra to a requirement for any successful business. So, to help you blast off into 2016, we here at Nosto have collected seven actionable tips:</span></p>\r\n<p><strong style=\"line-height: 1.6em;\">1. </strong><strong style=\"line-height: 1.6em;\">Collect Email Addresses for Retargeting in 2016</strong></p>\r\n<p>In Q4 you will get a lot of new traffic to your store. Take advantage of this by using pop-ups to help you increase the chance of festive sales while simultaneously capturing contact details for the future.</p>\r\n<p><span style=\"line-height: 1.6em;\">Two effective examples of this include:</span></p>\r\n<ul>\r\n<li>\r\n<p>Pop-ups which offer new visitors a discount in exchange for a subscription to your newsletter.</p>\r\n</li>\r\n<li>\r\n<p>Pop-ups to be triggered by exit intent of unidentified users, offering to send an email with items that the customer has left in their cart.</p>\r\n</li>\r\n</ul>\r\n<p><span style=\"line-height: 1.6em;\">Both of these options allow you to provide excellent customer service, incentivize and encourage shoppers to make purchases and help you capture the data you need to re-target them in 2016 with highly personalized recommendations or offers. It&rsquo;s a win-win!</span></p>\r\n<p><img style=\"width: 949px; height: 489px; margin: 10px;\" src=\"http://magento.com/sites/default/files/images/dreamandfun_popup.png\" alt=\"\" /></p>\r\n<p align=\"center\"><em>New customer pop-up at <a href=\"http://www.dreamandfun.com\" target=\"_blank\">www.dreamandfun.com</a> </em></p>\r\n<p><strong>2.</strong> <strong>Follow Up on December Orders</strong></p>\r\n<p>OK, so you have the email addresses, now what? First and foremost, send automated Order Follow up emails targeting customers with highly relevant items to those purchased in December. A great Follow-up email would also include a list of hottest items in your selection right now for a chance to show off your new spring selection and thus entice customers back to your store. &nbsp;</p>\r\n<p><strong style=\"line-height: 1.6em;\">3. Build Relationships Through &lsquo;We Miss You&rsquo; Emails</strong></p>\r\n<p>Triggered emailing is the holy grail of customer retention. That&rsquo;s why it earns two points in the list! Reach out to your customers with an automated &lsquo;We Miss You&rsquo; email triggered when the customer has not visited your store for a while. Populate the email with highly relevant and personalized product recommendations that indicate to your customer that you have learned their likes and dislikes. This will help you build a more personal relationship with them and make them more likely to return shopping with you.</p>\r\n<p class=\"rtecenter\"><img style=\"width: 1224px; height: 1474px; margin: 10px;\" src=\"http://magento.com/sites/default/files/images/melvinhamilton_WMY.png\" alt=\"\" /><br /> <em>A we miss you email by <a href=\"http://www.melvin-hamilton.com\" target=\"_blank\">www.melvin-hamilton.com</a></em></p>\r\n<p><strong style=\"line-height: 1.6em;\">4. Enable Personalized Facebook Ads to Re-engage Customers</strong></p>\r\n<p>Take advantage of the seasonal social media buzz and display automatically tailored offers directly in your customers&rsquo; newsfeeds. Target customers who have visited your store previously by recommending products picked just for them (e.g. items they browsed but didn&rsquo;t go on to purchase) or by suggesting items that are highly relevant to items that converted customers have already bought.</p>\r\n<p><img style=\"width: 652px; height: 536px; margin: 10px;\" src=\"http://magento.com/sites/default/files/images/Stuttenham_FB.png\" alt=\"\" /></p>\r\n<p align=\"center\"><em>Personalized Facebook ads of <a href=\"http://www.stutterheim.com\" target=\"_blank\">www.stutterheim.com</a> </em></p>\r\n<p><br /> <strong>5. Display Attention Grabbers on Your Home Page</strong></p>\r\n<p>As you know, not all gifts hit home and you&rsquo;ll be getting quite a few returns and exchanges in late December and throughout January. Fret not; there is an upside! It means that these customers are likely to come back to your store either to look for items to replace a gift or to learn about your returns terms. Make sure these customers are immediately greeted with the hottest new items in your selection to capture their interest again and ultimately complete a purchase. To increase conversion, add a top list and display personalized recommendations on your front page so that items the customer is most likely to purchase are the ones they see first.</p>\r\n<p><img style=\"width: 1213px; height: 544px; margin: 10px;\" src=\"http://magento.com/sites/default/files/images/Yumikim%20personalized%20recs.png\" alt=\"\" /></p>\r\n<p align=\"center\"><em>Personalized recommendations on the front page of </em><a href=\"http://www.yumikim.com/\" target=\"_blank\"><em>www.yumikim.com</em></a></p>\r\n<p><strong style=\"line-height: 1.6em;\">6. Give Out Coupons for January Purchases</strong></p>\r\n<p>Let&rsquo;s face it, by the time January rolls around we are all feeling the pinch (and we don&rsquo;t just mean from tighter-than-normal trousers!)<strong>. </strong>This means that shoppers are more likely to be discount-lead than normal. Delight these bargain hunters with a discount coupon for use in January when they complete a purchase in December. It&rsquo;s a simple and small surprise but one that will bring them back to your store despite a less than happy looking bank-account.</p>\r\n<p><strong>7. Reward Your Best Customers</strong></p>\r\n<p>New Year&rsquo;s is about new beginnings. Thank your best customers for the year past by sending them a small gift. This can be anything from a physical gift in your selection to a time-limited discount or other incentives that are exclusive to them. If you have the resources, do something even better, write them a personalized handwritten note to thank them for 2015 (A great example of exceptional customer service was<a href=\"https://www.reddit.com/r/reddit.com/comments/eabag/i_have_never_in_my_life_seen_this_level_of/\" target=\"_blank\"> posted on Reddit</a> a while back). They&rsquo;ll get more for less, return to your store, and you get more happy customers to kick off your 2016!</p>\r\n<p><strong>About Nosto</strong></p>\r\n<p>New to personalization and not sure how to get started? Magento Gold Partner&nbsp;<a href=\"http://partners.magento.com/partner_locator/partner_details.aspx?id=111567\" target=\"_blank\">Nosto</a>&nbsp;is offering Magento retailers the eBook &ldquo;An Introduction to Personalization&rdquo; for free download<a href=\"http://pages.nosto.com/an-introduction-to-personalization\" target=\"_blank\">&nbsp;here</a>.&nbsp;<br /> Nosto is the fastest-growing personalization solution in the world, enabling any online retailer to deliver their customers personalized shopping experiences wherever they are.<br /> Nosto&rsquo;s ease of use and speed of implementation empowers retailers to start growing their businesses within minutes of getting started, increasing conversion, average order value and customer retention.&nbsp;With offices in New York, London, Stockholm, Berlin and Helsinki, Nosto is used by over 12,000 retailers across the globe including Volcom, LUSH and The ICONIC. &nbsp;</p>\r\n<p>To learn more, visit <a href=\"http://www.nosto.com\" target=\"_blank\">www.nosto.com</a> or the <a href=\"http://www.magentocommerce.com/magento-connect/nosto-personalization-for-magento.html\" target=\"_blank\">Nosto magento extension</a>. <span style=\"line-height: 1.6em;\">You can find other important personalization tips by downloading this free</span><a style=\"line-height: 1.6em;\" href=\"http://pages.nosto.com/an-introduction-to-personalization\" target=\"_blank\"> eBook here</a><span style=\"line-height: 1.6em;\"> &nbsp;&ldquo;An Introduction to Personalization.&rdquo;&nbsp;</span></p>\r\n</div>','<p>Q4 is in full swing, but while you might not have even gotten around to dusting off the holiday ornaments yet, now is actually the best time to start preparing for a successful 2016! In fact, the earlier you start 2016 preparations</p>',1,1,'field/blog/blog2.jpg','1','1','','field/blog/blog2.jpg','1','1','','1column','Revealed: The Magento Mountaineer',NULL,'How to leverage the traffic and data you gather in Q4','','Holiday Prep, Partners',18,'2016-02-05 00:00:00','2016-10-31 03:10:57',0),(18,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','revealed-magento-mountaineer','<div class=\"field-item even\">\r\n<p><strong>Meet Andrii Vergeles, the engineer who waved the Magento flag at the top of the world.</strong></p>\r\n<p>The epic, snow-topped Caucasus Mountains are some of the tallest and most perilous peaks in Europe. Almost touching the sky between the Black and Caspian Seas, and occupied by Russia, Georgia, Azerbaijan, and Armenia&mdash;they provide mountaineers with difficult challenges.</p>\r\n<p>&ldquo;Climbing mountains is always dangerous, but being a positive-minded person I never think of death issues,&rdquo; admits Andrii Vergeles, 28, from Kiev. &ldquo;Though it is really risky, mountain climbing gives me so much pleasure.&rdquo; Five years ago, Andrii, a quality engineer at Magento&rsquo;s Kiev office, made a decision. He would climb &lsquo;Shkhara&rsquo;, the tallest peak in Georgia, and he would take with him a Magento flag.</p>\r\n<p>&nbsp;</p>\r\n<h1 class=\"rtecenter\"><span style=\"font-family: georgia,serif;\">\"It took us two full days to reach the summit\"</span></h1>\r\n<p>&nbsp;</p>\r\n<p><img style=\"width: 385px; height: 216px; padding-left: 15px; float: right;\" src=\"http://magento.com/sites/default/files/images/DSC_0238-Small.jpg\" alt=\"\" />It would not be a casual climb. The Caucasus Mountains are the same extreme peaks that Jason and the Argonauts climbed in their mythical quest for the Golden Fleece. Conditions there can range from mild to extreme, according to climbing guides. But the weather can change in an instant.</p>\r\n<p>&ldquo;As I remember, it took us two full days to reach the summit,&rdquo; recalls Andrii. When he reached the peak, at 17,040 ft., the exhausted climber proudly unfurled his flag.</p>\r\n<p>Today Andrii is a quality engineer at the Magento developer, Eltrino. He has now waved a Magento flag atop three other mountains in the Caucasus region. &nbsp;&ldquo;My job is still connected with the Magento platform,&rdquo; he explains, &ldquo;and the Magento 2.0 launch is a really important event.&rdquo; Andrii still wears a Magento sticker on his trusty safety helmet.</p>\r\n<p><img style=\"width: 183px; height: 220px; padding-right: 25px; float: left;\" src=\"http://magento.com/sites/default/files/images/-NMChvbW2Cw%20copy.jpg\" alt=\"\" /></p>\r\n<p>Like Magento, Andrii is always looking to reach new heights. He is planning a trip next autumn to scale mountains in Nepal and Pakistan. &ldquo;My friends and I are going on an expedition to Manaslu,&rdquo; he reveals. That mountain, a 26,781 ft. tall monster in the Nepalese Himalayas, will be his toughest challenge yet. But it is just the beginning, he says. &ldquo;There are many more mountains that I would like to climb.&rdquo;</p>\r\n</div>','<p>Meet Andrii Vergeles, the engineer who waved the Magento flag at the top of the world.</p>',1,1,'field/blog/blog1.jpg','1','1','','field/blog/blog1.jpg','1','1','','1column','Revealed: The Magento Mountaineer',NULL,'Meet Andrii Vergeles, the engineer who waved the Magento flag at the top of the world.','','Magento2',3,'2016-02-05 00:00:00','2016-10-31 03:11:00',0),(19,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','new-era-commerce-innovation','<div class=\"field-item even\">\r\n<p>Today we announced the general availability of our next generation open source digital commerce platform, Magento 2.0.&nbsp; The new platform empowers brands, retailers, and businesses across B2C and B2B industries to quickly and cost-effectively deliver engaging omnichannel shopping experiences. Magento 2.0 also offers enhanced performance and scalability, &nbsp;new features to boost conversion rates, and business agility and productivity improvements. The new platform also builds on our open source heritage and offers unmatched flexibility and innovation opportunities to our global ecosystem of partners and developers.</p>\r\n<p>Two new products based on this powerful platform are available for download today: Magento Enterprise Edition 2.0 and Magento Community Edition 2.0.</p>\r\n<p><strong>Open, Flexible Architecture</strong></p>\r\n<p>Underpinning these new releases is a next-generation architecture that offers unmatched flexibility to bring your commerce vision to life. It features a modular code base that enables easier customization, faster time-to-market, and greater deployment flexibility to public or private cloud environments. More extensive and efficient APIs allow you to connect and operate at scale with any third party solution, and theming capabilities make building site variations for new product lines or geographies easier than ever. A wide range of turnkey extensions also enable fast and affordable enhancements to your store.</p>\r\n<p><strong style=\"line-height: 1.6em;\">Engaging Shopping Experiences</strong></p>\r\n<p>Creating engaging, seamless and personalized customer experiences across any device is central to the Magento 2.0 platform. New responsive design reference themes give you a fast way to create sites that supports anytime, anywhere sales. And you can share your products in a more immersive way through integrated video. An all-new checkout is easier to customize and further improves conversion rates by minimizing steps and required information. You can also offer convenient, one-click account creation to save customer profiles for future purchases.&nbsp;</p>\r\n<p><strong style=\"line-height: 1.6em;\">Enhanced Business Agility and Productivity</strong></p>\r\n<p>Magento Commerce is also revolutionizing the merchant experience, enabling you to operate more efficiently and handle rapid growth, without scaling up your team. The new Admin panel design offers a streamlined, consumer-like interface that saves time when managing day-to-day tasks and is intuitive for new team members to learn. It is also touch-friendly so you can make updates or track sales while on-the-go.</p>\r\n<p>Improved business tools empower you to continuously optimize your operations to drive growth. You can now effortlessly customize and save views in the Admin panel to enable quick access to information critical to your business. Setting up new products is also faster, with a step-by-step product creation tool and product import capabilities that are 4x faster than before.</p>\r\n<p><strong>Enterprise-grade Scalability and Performance</strong></p>\r\n<p>The Magento platform has been supercharged to offer over 50% faster page load times across many catalog and checkout pages to help you delight your customers and improve conversion rates. It&nbsp;<span style=\"line-height: 1.6em;\">pre-integrates Varnish to cache page content for faster performance and optimizes code and images for fast loading. Your team will be delighted too, with improved Admin performance and support for more concurrent updates. Magento Enterprise Edition 2.0 also delivers enterprise-grade scalability and high availability with standalone master databases for key subsystems along with multiple slave databases.</span></p>\r\n<p><strong style=\"line-height: 1.6em;\">Secure Payments</strong></p>\r\n<p>Additionally, the Magento platform comes with tight out-of-the-box integrations with PayPal, Braintree, and Authorize.net payment gateways. Magento Enterprise Edition 2.0 also integrates with WorldPay and CyberSource. &nbsp;All versions provide improved security and the ability to pursue the easiest level of PCI compliance, depending on the selected payment method.</p>\r\n<p><strong style=\"line-height: 1.6em;\">Easier Maintenance and Upgrades</strong></p>\r\n<p>And finally, this modern, modular architecture reduces the complexity and cost of maintaining your site and it futureproofs your investment by simplifying upgrades. This means you can easily incorporate innovative functionality as it is released by Magento Commerce on a quarterly basis to drive higher sales and greater efficiency.</p>\r\n<p><strong style=\"line-height: 1.6em;\">Start Exploring Today</strong></p>\r\n<p>There are many ways to learn more about the powerful and innovative Magento Commerce platform:</p>\r\n<ul>\r\n<li>\r\n<p>To access product information, videos, and white papers visit the <a href=\"http://magento.com/products/enterprise-edition\" target=\"_blank\">Magento Enterprise Edition page</a>.</p>\r\n</li>\r\n<li>\r\n<p>To learn more about merchants already deployed on Magento Enterprise Edition 2.0, check out our <a href=\"http://magento.com/blog/magento-news/magento-20-delivers-early-adopter-merchants\" target=\"_blank\">early adopter blog post</a>.</p>\r\n</li>\r\n<li>\r\n<p>To find a Magento 2.0 Trained Solution Partner visit the <a href=\"http://partners.magento.com/partner_locator/search.aspx\" target=\"_blank\">Partner Directory</a>&nbsp;or the <a href=\"http://magento.com/blog/magento-news/look-magento-2-trained-solution-partners\" target=\"_blank\">blog post</a></p>\r\n</li>\r\n<li>\r\n<p>To see all the extensions available for Magento 2.0, visit our dedicated <a href=\"http://www.magentocommerce.com/magento-connect/magento-2\" target=\"_blank\">extension page</a>.</p>\r\n</li>\r\n</ul>\r\n<p>You can also start using the new software today. Existing Enterprise Edition customers can access it via <a href=\"https://www.magentocommerce.com/products/downloads/\" target=\"_blank\">MyAccount</a> &nbsp;and Community Edition users can download it from the Community Edition <a href=\"https://www.magentocommerce.com/download\" target=\"_blank\">download page</a>.</p>\r\n<p><span style=\"line-height: 1.6em;\">Welcome to next-generation commerce!</span></p>\r\n</div>','<p>Today we announced the general availability of our next generation open source digital commerce platform, Magento 2.0.&nbsp; The new platform empowers brands, retailers, and businesses across B2C and B2B industries to quickly and cost-effectively deliver engaging omnichannel shopping experiences. Magento 2.0 also offers enhanced performance and scalability</p>',1,1,'field/blog/blog4.jpg','1','1','','field/blog/blog4.jpg','1','1','','2columns-left','A New Era of Commerce Innovation','<p>Magento 2.0 enables retailers to rapidly innovate to deliver differentiated, engaging omnichannel experiences</p>','Magento 2.0 enables retailers to rapidly innovate to deliver differentiated, engaging omnichannel experiences','','Business News, Enterprise Edition, Magento 2, Products',19,'2016-02-05 00:00:00','2016-10-31 03:10:49',0),(20,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','look-magento-2-trained-solution-partners','<div class=\"field-item even\">\r\n<p>There are many Magento 2 Trained Solution Partners ready to take on your next project. Each Magento 2 Trained Solution Partner has invested over 100 hours in training to ensure readiness on the new platform. First, they hit the books: at least two employees completed the Fundamentals of Magento 2 Development course and one employee completed the Core Principles for Theming in Magento 2 course. Then, they had to pass a set of exercises that were graded by the Magento Development team - a truly tough challenge designed to prove their ability to apply Magento 2.0 principles.</p>\r\n<p><span style=\"line-height: 1.6em;\">To find Partners with a &ldquo;Magento 2 Trained&rdquo; specialization, go to the </span><a style=\"line-height: 1.6em;\" href=\"http://partners.magento.com/partner_locator/search.aspx?t=SolutionPartners\" target=\"_blank\">Magento Solution Partner Directory</a><span style=\"line-height: 1.6em;\"> or simply look for a Magento 2 Trained Solution Partner badge displayed in directory listings, websites or collateral. The Magento Sales team can also match you with a Magento 2Trained Solution Partner.</span></p>\r\n<p><strong style=\"line-height: 1.6em;\">As of today, 87 Solution Partners from around the globe have completed all of the program requirements, representing over 11,000 hours of Magento 2.0 training.</strong><strong style=\"line-height: 1.6em;\">This inaugural group of Partners includes:</strong></p>\r\n<div>\r\n<div>\r\n<p><strong>Gold Partners:</strong></p>\r\n</div>\r\n&nbsp;\r\n<div>\r\n<table style=\"width: 760px;\" border=\"0\" cellspacing=\"1\" cellpadding=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 212px;\">\r\n<p>Acidgreen</p>\