 Partners:</strong></p>\r\n</div>\r\n</div>\r\n<table style=\"width: 760px;\" border=\"0\" cellspacing=\"1\" cellpadding=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 212px;\">\r\n<p>comwrap</p>\r\n</td>\r\n<td style=\"width: 212px;\">\r\n<p>CueBlocks Technologies</p>\r\n</td>\r\n<td style=\"width: 212px;\">\r\n<p>Divante</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 212px;\">\r\n<p>Kensium</p>\r\n</td>\r\n<td style=\"width: 212px;\">\r\n<p>Online Visions</p>\r\n</td>\r\n<td style=\"width: 212px;\">\r\n<p>PulsarFour</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 212px;\">\r\n<p>Shop works</p>\r\n</td>\r\n<td style=\"width: 212px;\">\r\n<p>Sooryen</p>\r\n</td>\r\n<td style=\"width: 212px;\">\r\n<p>Webformat</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p><span style=\"line-height: 1.6em;\">Many more Magento 2 Trained Solution Partners will be joining the program soon, so be sure to check the </span><a style=\"line-height: 1.6em;\" href=\"http://partners.magento.com/partner_locator/search.aspx\" target=\"_blank\">Partner Directory</a><span style=\"line-height: 1.6em;\"> for updates.</span></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n</div>','<p>There are many Magento 2 Trained Solution Partners ready to take on your next project. Each Magento 2 Trained Solution Partner has invested over 100 hours in training to ensure readiness on the new platform. First, they hit the books: at least two employees completed the Fundamentals of Magento 2 Development course and one employee completed the Core Principles for Theming in Magento 2 course.</p>',1,1,'field/blog/blog3.jpg','1','1','','field/blog/blog3.jpg','1','1','','2columns-left','Look for Magento 2 Trained Solution Partners','<p>&nbsp;Magento Solution Partners are trained, tested and ready to take on Magento 2.0 projects</p>',' Magento Solution Partners are trained, tested and ready to take on Magento 2.0 projects','','Business News, Enterprise Edition, Magento 2, Products',10,'2016-02-05 00:00:00','2016-10-31 03:10:45',0),(22,'Lorem ipsum dolor sit amet, consectetuer adipiscing elit.','le-creuset-introduces-new-ecommerce-experience','<div class=\"field-item even\">\r\n<p><em>Originally posted on the</em>&nbsp;<em><a href=\"http://www.blueacorn.com/le-creuset-introduces-new-ecommerce-experience\" target=\"_blank\">Blue Acorn blog</a>.</em></p>\r\n<p>Everything I know about cooking, I learned from my dad. Over the years, Chef Bob, as we like to call him, has created mouth-watering meals for our family to enjoy together. While he&rsquo;s spent years perfecting his pot roast, we were definitely subjected to a few less-than-appealing dinners along the way (I&rsquo;ll spare you the gory details of the macaroni and cheese incident of &rsquo;93). Chef Bob&rsquo;s tastiest meals always shared one common trait: they began with his bright orange Le Creuset Dutch oven.</p>\r\n<p>That piece of Le Creuset cookware was also the foundation of my cooking lessons. I watched and learned as Chef Bob taught me how to properly brown meat before placing the enameled cast-iron pot in the oven while reminding me, &ldquo;Low and slow is the way to go.&rdquo; Like other home cooks, my dad sang the praises of Le Creuset&rsquo;s quality, noting that the orange Dutch oven would eventually become part of my kitchen, unintentionally creating the emotional connection the company so often finds in its customers.</p>\r\n<p>Ninety years ago,&nbsp;<a href=\"http://www.lecreuset.com/\" target=\"_blank\">Le Creuset</a>&nbsp;debuted its signature enameled cast iron cocotte and has since expanded its offerings to include stainless steel, silicone and stoneware. From a single product in 1925, the company has grown along with the demands of its consumers, inspiring them to create joy through cooking.</p>\r\n<p>For a company built on tradition and heritage, Le Creuset continues to excel at redefining its brand to include modern design, and its eCommerce site is no exception. Celebrating its 90th anniversary in 2015, the company identified an opportunity to rebrand the site to create a more rewarding user experience.</p>\r\n<p>Located in our shared city of Charleston, South Carolina, Le Creuset turned to Blue Acorn to create a modern, intuitive eCommerce site that would also capture the 90-year-old company&rsquo;s respect for tradition and authenticity. Le Creuset selected&nbsp;<a href=\"http://www.magento.com/\" target=\"_blank\">Magento Enterprise Edition</a>, in part, because the scalable platform allows for seamless international expansion.</p>\r\n<p>&ldquo;Blue Acorn understood our desire to balance world class content and compelling visual presentation with seamless transactional performance. Having an agency of their global caliber in our shared American home of Charleston was the icing on the cake,&rdquo; said Stephen Jones, vice president of marketing at Le Creuset.</p>\r\n<p>After defining design principles based on the timeless&nbsp;<a href=\"https://en.wikipedia.org/wiki/Bauhaus\" target=\"_blank\">Bauhaus</a>&nbsp;concept, Blue Acorn worked with Le Creuset&rsquo;s team of marketers, designers and photographers to rebrand the Le Creuset experience, from in-store to online. The new, responsive eCommerce site features engaging ways to shop for and filter products including by color, size, function and type of material with the swipe of a finger.</p>\r\n<p>The Internet has become a go-to source for easily accessible cooking tips and recipes by celebrity chefs and home cooks alike. The redesign includes robust content, such as recipes and profiles of top chefs, to create a captivating online cooking experience that appeals to Le Creuset&rsquo;s emotionally-guided customers.</p>\r\n<p>Magento Enterprise Edition&rsquo;s open-source technology performs at its best when amplified by best-of-breed technologies. After meeting with the Le Creuset team to determine the functionality they would need to deliver an exceptional customer experience today and in the future, Blue Acorn integrated modules from partners&nbsp;<a href=\"http://www.addshoppers.com/\" target=\"_blank\">AddShoppers</a>,&nbsp;<a href=\"http://www.avalara.com/\" target=\"_blank\">Avalara</a>,&nbsp;<a href=\"http://www.listrak.com/\" target=\"_blank\">Listrak</a>,&nbsp;<a href=\"http://www.powerreviews.com/\" target=\"_blank\">PowerReviews</a>&nbsp;and&nbsp;<a href=\"http://www.swiftype.com/\" target=\"_blank\">Swiftype</a>.</p>\r\n<p>All of these upgrades and additions to Le Creuset&rsquo;s eCommerce experience have resulted in an intuitive and engaging user experience. The site exudes a warmth that welcomes customers by invoking memories of cooking successes and shared meals, much like the ones I have of my dad and his bright orange Le Creuset Dutch oven.</p>\r\n<p><strong><img style=\"width: 140px; height: 140px; margin: 10px; float: left;\" src=\"http://magento.com/sites/default/files/images/BethanyKelley%20140x140.jpg\" alt=\"\" />About Bethany Kelley</strong><br /> After joining Blue Acorn\'s marketing team in 2014, Bethany jumped headfirst into the eCommerce world. Since then, she\'s focused on sharing Blue Acorn\'s achievements and client successes with the masses through social media, blogs, and press coverage.</p>\r\n<p>&nbsp;</p>\r\n</div>','<p><span>Everything I know about cooking, I learned from my dad. Over the years, Chef Bob, as we like to call him, has created mouth-watering meals for our family to enjoy together. While he&rsquo;s spent years perfecting his pot roast, we were definitely subjected to a few less-than-appealing dinners along the way (I&rsquo;ll spare you the gory details of the macaroni and cheese incident of &rsquo;93)</span></p>',1,1,'field/blog/blog2.jpg','1','1','','field/blog/blog2.jpg','1','1','','2columns-right','Le Creuset Introduces New Ecommerce Experience','Le Creuset Introduces New Ecommerce Experience','Le Creuset Introduces New Ecommerce Experience','','Enterprise Edition, Merchants,Partners',34,'2016-07-14 00:00:00','2016-10-31 03:10:43',1),(23,'MAKING IT LOOK LIKE READABLE, THAT IT HAS A.MAKING IT LOOK.','le-creuset-introduces-new-ecommerce-experience-v','<div class=\"field-item even\">\r\n<p><em>Originally posted on the</em>&nbsp;<em><a href=\"http://www.blueacorn.com/le-creuset-introduces-new-ecommerce-experience\" target=\"_blank\">Blue Acorn blog</a>.</em></p>\r\n<p>Everything I know about cooking, I learned from my dad. Over the years, Chef Bob, as we like to call him, has created mouth-watering meals for our family to enjoy together. While he&rsquo;s spent years perfecting his pot roast, we were definitely subjected to a few less-than-appealing dinners along the way (I&rsquo;ll spare you the gory details of the macaroni and cheese incident of &rsquo;93). Chef Bob&rsquo;s tastiest meals always shared one common trait: they began with his bright orange Le Creuset Dutch oven.</p>\r\n<p>That piece of Le Creuset cookware was also the foundation of my cooking lessons. I watched and learned as Chef Bob taught me how to properly brown meat before placing the enameled cast-iron pot in the oven while reminding me, &ldquo;Low and slow is the way to go.&rdquo; Like other home cooks, my dad sang the praises of Le Creuset&rsquo;s quality, noting that the orange Dutch oven would eventually become part of my kitchen, unintentionally creating the emotional connection the company so often finds in its customers.</p>\r\n<p>Ninety years ago,&nbsp;<a href=\"http://www.lecreuset.com/\" target=\"_blank\">Le Creuset</a>&nbsp;debuted its signature enameled cast iron cocotte and has since expanded its offerings to include stainless steel, silicone and stoneware. From a single product in 1925, the company has grown along with the demands of its consumers, inspiring them to create joy through cooking.</p>\r\n<p>For a company built on tradition and heritage, Le Creuset continues to excel at redefining its brand to include modern design, and its eCommerce site is no exception. Celebrating