y and in the future, Blue Acorn integrated modules from partners&nbsp;<a href=\"http://www.addshoppers.com/\" target=\"_blank\">AddShoppers</a>,&nbsp;<a href=\"http://www.avalara.com/\" target=\"_blank\">Avalara</a>,&nbsp;<a href=\"http://www.listrak.com/\" target=\"_blank\">Listrak</a>,&nbsp;<a href=\"http://www.powerreviews.com/\" target=\"_blank\">PowerReviews</a>&nbsp;and&nbsp;<a href=\"http://www.swiftype.com/\" target=\"_blank\">Swiftype</a>.</p>\r\n<p>All of these upgrades and additions to Le Creuset&rsquo;s eCommerce experience have resulted in an intuitive and engaging user experience. The site exudes a warmth that welcomes customers by invoking memories of cooking successes and shared meals, much like the ones I have of my dad and his bright orange Le Creuset Dutch oven.</p>\r\n<p><strong><img style=\"width: 140px; height: 140px; margin: 10px; float: left;\" src=\"http://magento.com/sites/default/files/images/BethanyKelley%20140x140.jpg\" alt=\"\" />About Bethany Kelley</strong><br /> After joining Blue Acorn\'s marketing team in 2014, Bethany jumped headfirst into the eCommerce world. Since then, she\'s focused on sharing Blue Acorn\'s achievements and client successes with the masses through social media, blogs, and press coverage.</p>\r\n<p>&nbsp;</p>\r\n</div>','<p><span>Everything I know about cooking, I learned from my dad. Over the years, Chef Bob, as we like to call him, has created mouth-watering meals for our family to enjoy together. While he&rsquo;s spent years perfecting his pot roast, we were definitely subjected to a few less-than-appealing dinners along the way (I&rsquo;ll spare you the gory details of the macaroni and cheese incident of &rsquo;93)</span></p>',1,1,'field/blog/blog1.jpg','1','1','','field/blog/blog1.jpg','1','1','','2columns-right','Le Creuset Introduces New Ecommerce Experience','Le Creuset Introduces New Ecommerce Experience','Le Creuset Introduces New Ecommerce Experience','','Enterprise Edition, Merchants,Partners',29,'2